INSERT INTO `offres` VALUES (11,'2022-10-13','2022-12-05','publish','Consultant Technico-Fonctionnel ERP (GRH-PAIE)','2022-10-13','2023-10-13','Emploi','Plein temps','Algérie','Alger','','Consultant Technico-Fonctionnel ERP (GRH-PAIE)','<p><span style=\"font-size: 11pt;font-family: Orkney;\">Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs ?</span><br><br><span style=\"font-size: 11pt;font-family: Orkney;\">Vous avez une expertise d’intégration des solutions<br>informatiques de gestion GRH/Paie. Idéalement, un dans un ERP avec une très bonne connaissance des métiers et<br>fonctions de la GRH/Paie. Rejoignez nos experts !</span><br><br><span style=\"font-size: 11pt;font-family: Orkney;\">Intégrer au sein de nos équipes projets, vous prendrez<br>en charge la gestion complète des projets d’implémentation de l’ERP GRH/Paie.</span></p>\n<p><span style=\"font-size: 11pt;font-family: Orkney;\">CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. </span>&nbsp;</p>\n','<p><span style=\"background-color: white;font-family: Orkney;\">Profil : -H/F</span> <span style=\"background-color: white;font-family: Orkney;\">:</span></p>\n<p><br>- <span style=\"background-color: white;font-family: Orkney;\">Diplômé(e) d’un BAC+ 5 en informatique, avec connaissances métier GRH/PAIE.</span><br>- <span style=\"background-color: white;font-family: Orkney;\">Expérience de 1 à 3 minimum ans dans l’intégration de<br>solutions GRH/PAIE.</span><br><span style=\"background-color: white;font-family: Orkney;\">-</span> <span style=\"background-color: white;font-family: Orkney;\">Connaissances de l’ERP SAP est un plus.</span></p>\n','<p><span style=\"font-family: Orkney;\">Votre capacité rédactionnelle, votre esprit d’initiative, votre sens de l’organisation et de la rigueur seront autant d’atouts pour réussir dans ce poste.Vous êtes également doté de véritables capacités<br>relationnelles et de travail en équipe et vous êtes rompue à la culture de l’engagement. CM Consulting vous offre les possibilités de carrière et de montée en compétence que vous recherchez.</span>&nbsp;</p>\n',2087,'2022-10-13 10:14:57','2022-12-05 11:59:11'),(12,'2022-10-13','2022-12-29','publish','Consultant Technique ERP','2022-10-13','2023-10-13','Emploi','Plein temps','Algérie','Alger','','Consultant Technique ERP','<p>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoins nos experts !</p>\n<p>Intégré à nos équipes projets, vous participerez à la réalisation des projets d\'implémentation de l\'ERP.</p>\n<p>Vous prenez en charge le développement d\'applications connexes, des interfaces et de pultiples programmes spécifiques.&nbsp;</p>\n<p>Vous aurez également la responsabilité de développer les éditions et états de synthèse.</p>\n<p>Vous avez une première expériene dans le développement en dot net, java, web idéalement sous contraintes, notamment au sein d\'applications de gestion de type ERP ?</p>\n<p>Vous connaissez Crystal Reports BI et vous maîtrisez le langage de requête SQL ?<br><br>&nbsp;</p>\n','<p>- Diplômé(e) d\'un BAC+5 ou TS en informatique, option système d\'information, Software...</p>\n<p>- Avec ou sans expérience dans le développement informatique (dot.net, java,web...)</p>\n<p>- Connaissances du monde de l\'ERP et de l\'intégration de solutions de gestion d\'entreprises est un atout.</p>\n','<p></p>\n',2088,'2022-10-13 10:17:55','2022-12-29 09:24:10'),(13,'2022-10-13','2022-12-29','publish','Consultant Technico-fonctionnel ERP','2022-10-13','2023-10-13','Emploi','Plein temps','Algérie','Alger','','Consultant Technico-fonctionnel ERP','<p>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos experts&nbsp;</p>\n<p>Le langage SQL n’a aucun secret pour vous ! Alors si l’immersion dans différents cœur métier vous passionne aussi bien que la compétence, rejoignez notre équipe technique qui vous attend de pied ferme.</p>\n<p>Intégré à nos équipes projets, vous participerez à la réalisation des projets d’implémentation de l’ERP.</p>\n<p>Vous avez ou non une expérience d’intégration des solutions informatiques de gestion d’entreprises. Idéalement, un ERP avec une bonne connaissance des métiers et fonctions de l’entreprises (comptabilité, achats, ventes, stocks, la paie, la gestion de projet et de production...)</p>\n','<p>Diplômé(e) d’un BAC+5 ou Technicien Supérieur en informatique, option système d’information, Software, décisionnel...</p>\n<p>Connaissance de l’environnement SAP et Crystal Report est un plus</p>\n','<p></p>\n',2089,'2022-10-13 10:19:35','2022-12-29 09:29:46'),(14,'2022-10-13','2024-12-04','publish','Community Management','2022-10-13','2023-10-13','Stage','Plein temps','Algérie','Alger','','Community Management 2','<p>Tu es à l\'aise avec les réseaux sociaux et l\'animation de communauté ?</p>\n<p>Tu as une forte culture digitale et tu es au fait des dernières stratégies et tendances digitales, ce qui te permet d’être force de proposition et d’innover ?</p>\n','<p></p>\n<p>Cher(e) futur(e) candidat(e), nous attendrons de toi :&nbsp;&nbsp;</p>\n<p>- Dynamisme, pro-activité, et esprit d’initiative</p>\n<p>- Organisation / Esprit d’équipe</p>\n<p>- Élaborer et tenir à jour le planning social media;</p>\n<p>- Animer et modérer notre communauté : répondre aux questions, aux commentaires, créer des stories pertinentes, des lives quand cela est opportun...</p>\n<p>- Assurer une veille journalière : rebondir sur l’actualité des ESN et l’écosystème IT;</p>\n<p>- Assurer une veille concurrentielle récurrente;</p>\n<p>- Définir et mettre en œuvre une stratégie de marketing d\'influence;</p>\n<p>- Créer des contenus originaux pour nos différentes plateformes et évènements (email, réseaux sociaux, newsletters, événements physiques...)&nbsp;</p>\n<p>- Assurer le suivi et le reporting des performances;&nbsp;</p>\n<p></p>\n<p>Durée du stage : 06 mois&nbsp;</p>\n<p>Lieu : Ben Aknoun - Alger&nbsp;</p>\n','<p>Tu es intéressé(e) par cette opportunité de stage, merci de postuler rapidement !</p>\n',2090,'2022-10-13 10:21:15','2024-12-04 14:53:42'),(26,'2022-10-31','2022-10-31','publish','Administrateur réseau & systèmes','2022-10-31','2022-12-01','Emploi','Plein temps','Algérie','Alger','','Administrateur réseau & systèmes','<p>&nbsp;<span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">Rattaché au responsable infrastructure, vous êtes en charge de l\'administration des système &amp; infrastructures des clients.</span>&nbsp;</p>\n<p><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">Vous avez pour mission : </span>&nbsp;</p>\n<ul>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Veiller au bon fonctionnement de l’infrastructure IT de l’entreprise (Installation, configuration).</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Assurer la mise à niveau et l’évolution de l’infrastructure IT en fonction des besoins de l’entreprise.</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Analyser les besoins du client</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Assurer la disponibilité des services IT aux utilisateurs (Supervision, monitoring, dépannage…).</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Participation active dans des projets.</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Administration des réseaux LAN, WAN, VPN de l’entreprise (Switching/Routing).</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Administration d’une plateforme virtuelle VMWARE, Hyper-V.</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Gestion d’un domaine Active Directory Microsoft Windows 2019.</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Gestion opérationnelle des sauvegardes de données via Veeam, </span><a href=\"https://www.veritas.com/fr/fr/protection/netbackup\" target=\"_self\"><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">NetBackup</span></a><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">..</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Gestion opérationnelle de la sécurité des SI (Firewalling SOPHOS, Fortinet…).</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Assurer un rôle de support et d’assistance technique auprès des équipes informatiques du client</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Veiller au respect des normes et des procédures de qualité et de sécurité</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Accompagner les évolutions techniques.</span>&nbsp;</li>\n<li><span style=\"color: rgb(5,5,5);background-color: white;font-size: 11.5pt;font-family: inherit;\">Formaliser les process</span>&nbsp;</li>\n</ul>\n','<p><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">De formation Bac+5, vous justifiez d’une expérience de 2 ans minimum dans un poste similaire Sérieux, autonome, impliqué. </span></p>\n<p><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">Vous disposez de bonnes capacités d’analyse et relationnelles pour le suivi client.</span></p>\n','<p><span style=\"font-size: 18pt;font-family: Arial Narrow;\">Compétences techniques requises</span>&nbsp;</p>\n<p><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">Vous justifiez de connaissances et d’expériences techniques dans les environnements Microsoft Windows, Azure, Office 365, Exchange, Bases de</span><br><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">données SQL, VMWare, SAN/NAS.</span>&nbsp;</p>\n<p><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">Vous avez de bonnes compétences sur l\'environnement Wan, Lan et les réseaux IP, l\'administration des matériels réseaux (switch, routeurs, firewalls, wifi...) et les technologies de téléphonie sur IP. </span>&nbsp;</p>\n<p><span style=\"color: rgb(5,5,5);font-size: 11.5pt;font-family: inherit;\">Connaissance des solutions SAP HANA est un plus.</span>&nbsp;</p>\n',2133,'2022-10-31 11:01:05','2022-10-31 11:01:23'),(31,'2022-12-29',NULL,'publish','Développeur Full Stack','2022-12-29','2022-12-29','Emploi','Plein temps','Algérie','Alger','rh@cmconsulting-dz.com','Développeur Full Stack','<p>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos experts !</p>\n<p>&nbsp;Missions du poste :&nbsp;</p>\n<p>- Développement des applications web ou mobile pour nos besoins opérationnels.&nbsp;</p>\n<p>- Participer à la mise en œuvre des outils développés auprès des utilisateurs finaux.&nbsp;</p>\n<p>- Maintenir la disponibilité des outils existants et en assurer les évolutions.</p>\n','<p>- Passionné par le développement et la conception, aisance relationnelle pour communiquer clairement par vos actions.&nbsp;&nbsp;</p>\n<p>- Capacité à écrire du code propre et bien documenté.&nbsp;</p>\n<p>- Conception d’interface utilisateur, sens du design.&nbsp;</p>\n<p>- Maîtrise des technologies suivantes : HTML, CSS, PHP, JavaScript, React Native, GIT, SQL.</p>\n','<p></p>\n',2135,'2022-12-29 09:39:35','2022-12-29 09:39:35'),(32,'2023-01-10',NULL,'publish','Développeur Java','2023-01-10','2023-01-10','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Développeur Java','<p><span style=\"font-size: 12pt;\">CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos experts !</span>&nbsp;&nbsp;</p>\n<p><span style=\"font-size: 12pt;\">Les missions sont les suivantes :</span>&nbsp;&nbsp;&nbsp;</p>\n<ul>\n<li><span style=\"font-size: 12pt;\">Concevoir, développer et maintenir des services métiers et des API REST</span>&nbsp;&nbsp;</li>\n<li><span style=\"font-size: 12pt;\">Contribuer à toutes les phases du cycle de développement</span>&nbsp;&nbsp;</li>\n<li><span style=\"font-size: 12pt;\">Produire un code propre, documenté et réutilisable</span>&nbsp;&nbsp;</li>\n<li><span style=\"font-size: 12pt;\">Rédiger et maintenir les tests ainsi que la documentation technique</span>&nbsp;&nbsp;</li>\n<li><span style=\"font-size: 12pt;\">Partager ton expérience et monter en compétences avec les autres membres de l’équipe</span>&nbsp;&nbsp;&nbsp;</li>\n</ul>\n','<p><span style=\"font-size: 12pt;\">Compétences techniques :</span>&nbsp;</p>\n<p><span style=\"font-size: 12pt;\">La connaissance de Framework Spring boot </span>&nbsp;</p>\n<p><span style=\"font-size: 12pt;\">Vous avez une connaissance des architectures distribuées et des architectures orientées micro-services</span>&nbsp;&nbsp;</p>\n<p><span style=\"font-size: 12pt;\">Vous avez une connaissance des méthodologies agiles (Kanban, Scrum)</span>&nbsp;&nbsp;</p>\n<p><span style=\"font-size: 12pt;\">Vous avez des compétences éprouvées en ingénierie (code versioning, Peer review)</span>&nbsp;</p>\n','<ul>\n<li>Windows / Linux&nbsp;</li>\n<li>JavaScript, CSS, HTML, ReactJS&nbsp;</li>\n<li>MySQL, MongoDB, PostgreSQL&nbsp;&nbsp;</li>\n<li>Gitlab, Docker&nbsp;&nbsp;</li>\n</ul>\n',2137,'2023-01-10 13:30:57','2023-01-10 13:30:57'),(33,'2023-06-25',NULL,'publish','Community Manager','2023-06-25','2023-08-31','Emploi','Plein temps','Algérie','Alger','marketing@cmconsulting-dz.com','Community Manager','<p>&nbsp;CM Consulting, une entreprise technologique<br>leader en Algérie, recherche une personne dynamique et talentueuse pour<br>rejoindre notre équipe en tant que Responsable de communauté. Dans ce rôle,<br>vous serez responsable de la création et de la gestion d\'une communauté en<br>ligne solide pour notre marque, en favorisant l\'engagement et en promouvant des<br>interactions positives. En tant que Responsable de communauté, vous jouerez un<br>rôle essentiel dans l\'amélioration de notre présence en ligne et le<br>renforcement de nos relations avec les clients, les parties prenantes et les<br>influenceurs de l\'industrie.&nbsp;</p>\n<p>Responsabilités :&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Développer et mettre en œuvre une<br>stratégie complète de gestion de communauté alignée sur la vision et les<br>objectifs de la marque CM Consulting.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Créer du contenu attractif, y compris<br>des publications sur les réseaux sociaux, des articles de blog, des newsletters<br>et d\'autres supports de communication pour attirer et fidéliser les membres de<br>la communauté.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Surveiller et modérer les<br>plateformes en ligne, y compris les réseaux sociaux, les forums et les sites<br>web communautaires, afin de garantir un environnement positif et respectueux.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Répondre aux demandes,<br>commentaires et rétroactions de la communauté de manière professionnelle et en<br>temps opportun, en adoptant une approche centrée sur le client.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Établir et entretenir des<br>relations avec les membres de la communauté, les parties prenantes et les<br>influenceurs de l\'industrie pour favoriser l\'engagement et l\'adhésion.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Collaborer avec des équipes<br>interfonctionnelles, notamment le marketing, le service client et le<br>développement de produits, pour recueillir des informations et intégrer les<br>retours de la communauté dans les stratégies commerciales.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Organiser et gérer des événements<br>communautaires, en ligne et hors ligne, tels que des webinaires, des chats en<br>direct, des rencontres et des conférences, pour favoriser les échanges et le<br>partage de connaissances.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Surveiller et analyser les<br>principales mesures de la communauté, et fournir régulièrement des rapports à<br>la direction, mettant en évidence les tendances, les opportunités et les défis.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Rester à jour sur les tendances de<br>l\'industrie, les meilleures pratiques et les technologies émergentes en matière<br>de gestion de communauté, et formuler des recommandations pour l\'amélioration<br>continue.&nbsp;&nbsp;</p>\n','<h2>Qualifications :</h2>\n<p style=\"margin-left:36pt;\">? Diplôme universitaire en<br>communication, marketing, commerce ou dans un domaine connexe.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Expérience avérée en gestion de<br>communauté, en gestion des médias sociaux ou en marketing numérique.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Solide compréhension de la<br>dynamique des communautés en ligne, des plateformes de médias sociaux et des<br>systèmes de gestion de contenu.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Excellentes compétences en<br>communication écrite et verbale en français et en arabe, avec la capacité<br>d\'adapter les messages à différents publics.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Compétences interpersonnelles<br>exceptionnelles et capacité à établir des relations avec des parties prenantes<br>diverses.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Esprit analytique avec la capacité<br>d\'interpréter les données, de suivre les mesures et de fournir des informations<br>exploitables.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Capacité à penser de manière<br>créative et à résoudre des problèmes pour engager et fidéliser efficacement les<br>membres de la communauté.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Maîtrise des outils et plateformes<br>de gestion des médias sociaux.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Passion pour la technologie et<br>capacité à se tenir informé des dernières tendances de l\'industrie.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Capacité à travailler de manière<br>autonome, à gérer plusieurs tâches simultanément et à respecter les délais dans<br>un environnement dynamique.&nbsp;&nbsp;</p>\n','<h2>Avantages :&nbsp;</h2>\n<p>&nbsp;&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Rémunération compétitive, basée<br>sur l\'expérience et les compétences.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Environnement de travail dynamique<br>au sein d\'une entreprise technologique leader en Algérie.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Opportunités de développement<br>professionnel et de croissance au sein de l\'entreprise.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Collaboration avec une équipe<br>talentueuse et passionnée.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Possibilité d\'apporter des idées<br>novatrices et de contribuer activement à la stratégie de l\'entreprise.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Environnement de travail axé sur<br>l\'équilibre entre vie professionnelle et vie personnelle.&nbsp;</p>\n<p></p>\n<p>Rejoignez l\'équipe de CM Consulting en tant<br>que Responsable de communauté et devenez un acteur essentiel de notre<br>communauté en ligne florissante. Si vous êtes passionné par l\'établissement de<br>liens significatifs, la stimulation de l\'engagement et la création d\'une<br>perception positive de la marque, nous voulons vous entendre. Postulez dès aujourd\'hui<br>et contribuez à notre mission de révolutionner le paysage technologique<br>algérien !&nbsp;</p>\n<p>Pour postuler, veuillez soumettre votre CV et<br>tout portfolio ou présence en ligne pertinent mettant en valeur votre<br>expérience en gestion de communauté.&nbsp;&nbsp;</p>\n',2140,'2023-06-25 14:43:41','2023-06-25 14:43:41'),(34,'2023-06-25','2024-12-04','publish','Community Manager','2023-06-25','2023-08-31','Emploi','Plein temps','Algérie','Alger','marketing@cmconsulting-dz.com','Community Manager ','<p>11334564645&nbsp;</p>\n<p></p>\n<p>CM Consulting, une entreprise technologique<br>leader en Algérie, recherche une personne dynamique et talentueuse pour<br>rejoindre notre équipe en tant que Responsable de communauté. Dans ce rôle,<br>vous serez responsable de la création et de la gestion d\'une communauté en<br>ligne solide pour notre marque, en favorisant l\'engagement et en promouvant des<br>interactions positives. En tant que Responsable de communauté, vous jouerez un<br>rôle essentiel dans l\'amélioration de notre présence en ligne et le<br>renforcement de nos relations avec les clients, les parties prenantes et les<br>influenceurs de l\'industrie.&nbsp;</p>\n<p>Responsabilités :&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Développer et mettre en œuvre une<br>stratégie complète de gestion de communauté alignée sur la vision et les<br>objectifs de la marque CM Consulting.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Créer du contenu attractif, y compris<br>des publications sur les réseaux sociaux, des articles de blog, des newsletters<br>et d\'autres supports de communication pour attirer et fidéliser les membres de<br>la communauté.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Surveiller et modérer les<br>plateformes en ligne, y compris les réseaux sociaux, les forums et les sites<br>web communautaires, afin de garantir un environnement positif et respectueux.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Répondre aux demandes,<br>commentaires et rétroactions de la communauté de manière professionnelle et en<br>temps opportun, en adoptant une approche centrée sur le client.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Établir et entretenir des<br>relations avec les membres de la communauté, les parties prenantes et les<br>influenceurs de l\'industrie pour favoriser l\'engagement et l\'adhésion.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Collaborer avec des équipes<br>interfonctionnelles, notamment le marketing, le service client et le<br>développement de produits, pour recueillir des informations et intégrer les<br>retours de la communauté dans les stratégies commerciales.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Organiser et gérer des événements<br>communautaires, en ligne et hors ligne, tels que des webinaires, des chats en<br>direct, des rencontres et des conférences, pour favoriser les échanges et le<br>partage de connaissances.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Surveiller et analyser les<br>principales mesures de la communauté, et fournir régulièrement des rapports à<br>la direction, mettant en évidence les tendances, les opportunités et les défis.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Rester à jour sur les tendances de<br>l\'industrie, les meilleures pratiques et les technologies émergentes en matière<br>de gestion de communauté, et formuler des recommandations pour l\'amélioration<br>continue.&nbsp;&nbsp;</p>\n','<h2>Qualifications :</h2>\n<p style=\"margin-left:36pt;\">? Diplôme universitaire en<br>communication, marketing, commerce ou dans un domaine connexe.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Expérience avérée en gestion de<br>communauté, en gestion des médias sociaux ou en marketing numérique.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Solide compréhension de la<br>dynamique des communautés en ligne, des plateformes de médias sociaux et des<br>systèmes de gestion de contenu.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Excellentes compétences en<br>communication écrite et verbale en français et en arabe, avec la capacité<br>d\'adapter les messages à différents publics.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Compétences interpersonnelles<br>exceptionnelles et capacité à établir des relations avec des parties prenantes<br>diverses.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Esprit analytique avec la capacité<br>d\'interpréter les données, de suivre les mesures et de fournir des informations<br>exploitables.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Capacité à penser de manière<br>créative et à résoudre des problèmes pour engager et fidéliser efficacement les<br>membres de la communauté.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Maîtrise des outils et plateformes<br>de gestion des médias sociaux.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Passion pour la technologie et<br>capacité à se tenir informé des dernières tendances de l\'industrie.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Capacité à travailler de manière<br>autonome, à gérer plusieurs tâches simultanément et à respecter les délais dans<br>un environnement dynamique.&nbsp;&nbsp;</p>\n','<h2>Avantages :&nbsp;</h2>\n<p>&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Rémunération compétitive, basée<br>sur l\'expérience et les compétences.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Environnement de travail dynamique<br>au sein d\'une entreprise technologique leader en Algérie.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Opportunités de développement<br>professionnel et de croissance au sein de l\'entreprise.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Collaboration avec une équipe<br>talentueuse et passionnée.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Possibilité d\'apporter des idées<br>novatrices et de contribuer activement à la stratégie de l\'entreprise.&nbsp;</p>\n<p style=\"margin-left:36pt;\">? Environnement de travail axé sur<br>l\'équilibre entre vie professionnelle et vie personnelle.&nbsp;</p>\n<p></p>\n<p>Rejoignez l\'équipe de CM Consulting en tant<br>que Responsable de communauté et devenez un acteur essentiel de notre<br>communauté en ligne florissante. Si vous êtes passionné par l\'établissement de<br>liens significatifs, la stimulation de l\'engagement et la création d\'une<br>perception positive de la marque, nous voulons vous entendre. Postulez dès aujourd\'hui<br>et contribuez à notre mission de révolutionner le paysage technologique<br>algérien !&nbsp;</p>\n<p>Pour postuler, veuillez soumettre votre CV et<br>tout portfolio ou présence en ligne pertinent mettant en valeur votre<br>expérience en gestion de communauté.&nbsp;&nbsp;</p>\n',2141,'2023-06-25 14:43:43','2024-12-04 14:58:59'),(35,'2024-02-15',NULL,'publish','DevOps','2024-02-15','2024-02-20','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','DevOps','<p style=\"text-align:center;\">&nbsp;<span style=\"color: black;background-color: white;font-size: 16pt;font-family: Orkney;\">Consultant Technico-fonctionnel<br>ERP</span>&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p>CM<br>Consulting, c’est avant tout un collectif d’experts en digitalisation, tous<br>unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et<br>vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos<br>experts !&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p>Le<br>langage SQL n’a aucun secret pour vous ! Alors si l’immersion dans différents<br>cœur métier vous passionne aussi bien que la compétence, rejoignez notre équipe<br>techn