lle, votre esprit d’initiative, votre sens de l’organisation et<br>votre rigueur seront autant d’atouts pour réussir dans ce poste.</span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Vous êtes également<br>doté de véritables capacités relationnelles et de travail en équipe et vous<br>êtes rompue à la culture de l’engagement. CM Consulting vous offre les<br>possibilités d’une carrière évolutive et d’une montée en compétence continue.</span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Merci de transmettre<br>vos candidatures à l’adresse</span> <span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">:<br></span><a href=\"mailto:recrutement@cmconsulting-dz.com\" target=\"_self\"><span style=\"color: black;background-color: white;\">recrutement@cmconsulting-dz.com</span></a>&nbsp;&nbsp;</p>\n','<p></p>\n','<p></p>\n',2152,'2024-02-15 14:47:17','2024-02-15 14:47:17'),(36,'2024-02-15',NULL,'publish','DevOps','2024-02-15','2024-02-20','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','DevOps','<p style=\"text-align:center;\">&nbsp;<span style=\"color: black;background-color: white;font-size: 16pt;font-family: Orkney;\">Consultant Technico-fonctionnel<br>ERP</span>&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p>CM<br>Consulting, c’est avant tout un collectif d’experts en digitalisation, tous<br>unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et<br>vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos<br>experts !&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p>Le<br>langage SQL n’a aucun secret pour vous ! Alors si l’immersion dans différents<br>cœur métier vous passionne aussi bien que la compétence, rejoignez notre équipe<br>technique qui vous attend de pied ferme.&nbsp;</p>\n<p>&nbsp;&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Intégré à nos équipes<br>projets, vous participerez à la réalisation des projets d’implémentation de<br>l’ERP. </span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Vous avez ou non une expérience<br>d’intégration des solutions informatiques de gestion d’entreprises. Idéalement,<br>un ERP avec une bonne connaissance des métiers et fonctions de l’entreprises<br>(comptabilité, achats, ventes, stocks, la paie, la gestion de projet et de<br>production…)</span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Profil<br>: -H/F</span> <span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">:</span>&nbsp;&nbsp;</p>\n<ul>\n<li style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Diplômé(e) d’un BAC+5 Polytechnique,<br>     Recherche Opérationnelle…</span>&nbsp;</li>\n<li style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Diplômé(e) d’un BAC+5 ou<br>     Technicien Supérieur en informatique, option système d’information,<br>     Software, décisionnel… </span>&nbsp;</li>\n<li style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Connaissance de l’environnement<br>     SAP et </span><span style=\"color: black;background-color: white;font-family: Orkney;\">Crystal Report </span><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">est un<br>     plus</span>&nbsp;</li>\n</ul>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Votre capacité<br>rédactionnelle, votre esprit d’initiative, votre sens de l’organisation et<br>votre rigueur seront autant d’atouts pour réussir dans ce poste.</span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Vous êtes également<br>doté de véritables capacités relationnelles et de travail en équipe et vous<br>êtes rompue à la culture de l’engagement. CM Consulting vous offre les<br>possibilités d’une carrière évolutive et d’une montée en compétence continue.</span>&nbsp;</p>\n<p style=\"text-align:justify;\"><span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">Merci de transmettre<br>vos candidatures à l’adresse</span> <span style=\"color: rgb(51,51,51);background-color: white;font-family: Orkney;\">:<br></span><a href=\"mailto:recrutement@cmconsulting-dz.com\" target=\"_self\"><span style=\"color: black;background-color: white;\">recrutement@cmconsulting-dz.com</span></a>&nbsp;&nbsp;</p>\n','<p></p>\n','<p></p>\n',2153,'2024-02-15 14:47:20','2024-02-15 14:47:20'),(37,'2024-07-24',NULL,'publish','Consultant SAP S/4HANA','2024-07-24','2024-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Consultant SAP S/4HANA','<p>Nous recherchons des consultants SAP S/4HANA (FI, CO, SD, MM, PP, QM, PM, PS, HCM, SCM) engagés et<br>enthousiastes pour enrichir notre équipe exceptionnelle.&nbsp;</p>\n<p>En tant que consultant SAP S/4HANA, vous serez au cœur de notre mission pour révolutionner les<br>processus métier de nos clients avec des solutions innovantes et sur mesure.&nbsp;</p>\n<p>Ce que vous allez faire :&nbsp;&nbsp;</p>\n<ul>\n<li>Innover au quotidien : Analysez les besoins uniques de nos clients et concevez des solutions SAP S/4HANA qui transforment leur manière de travailler. Chaque projet est une nouvelle opportunité pour créer de la valeur et faire la différence.&nbsp;</li>\n<li>Collaborer avec passion : Travaillez étroitement avec nos clients pour comprendre leurs défis et leurs objectifs. Votre expertise sera le catalyseur de leur succès et de leur croissance.&nbsp;</li>\n<li>Créer des solutions sur mesure : Contribuez à la conception, configuration et mise en œuvre de systèmes SAP S/4HANA parfaitement adaptés à chaque client.&nbsp;</li>\n<li>Former et inspirer : Accompagnez les utilisateurs finaux dans l’adoption de solutions innovantes et maximisez leur utilisation des fonctionnalités.&nbsp;</li>\n<li>Évoluer ensemble : Offrez un soutien continu après l’implémentation et participez à l\'amélioration continue de nos solutions innovantes.&nbsp;&nbsp;</li>\n</ul>\n','<p>&nbsp;Ce que nous recherchons :&nbsp;&nbsp;</p>\n<ul>\n<li>Une solide expérience dans la mise en œuvre de projets SAP S/4HANA, avec une passion pour l’excellence et l’innovation.&nbsp;</li>\n<li>Des compétences exceptionnelles en communication et en gestion de la relation client, avec une capacité à jongler entre plusieurs projets.&nbsp;</li>\n<li>Un diplôme en informatique, en génie des systèmes d\'information ou un domaine connexe, et une motivation sans faille pour développer vos compétences et rester à jour avec les dernières évolutions technologiques.</li>\n</ul>\n','<p>Pourquoi nous rejoindre ?</p>\n<p><br>En intégrant notre équipe, vous évoluerez dans un environnement où l\'innovation est au cœur de chaque projet. Vous aurez l\'opportunité de relever des défis stimulants tout en bénéficiant d\'un cadre de travail collaboratif et de nombreuses opportunités de développement professionnel.&nbsp;</p>\n<p>Nous proposons un package de rémunération<br>attractive et des avantages sociaux conçus pour votre épanouissement personnel<br>et professionnel.&nbsp;&nbsp;&nbsp;</p>\n',2159,'2024-07-24 16:03:29','2024-07-24 16:03:29'),(38,'2024-11-05',NULL,'publish','Référent métier SI Santé','2024-11-05','2024-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Référent métier SI Santé','<p>Rejoignez CM Consulting et contribuez à l\'innovation dans le secteur de la santé !<br><br>Nous recherchons un Référent métier SI Santé passionné pour rejoindre notre <br>équipe au cœur de la transformation digitale. Votre mission :<br><br>? Analyser les besoins utilisateurs</p>\n<p><br>? Modéliser les processus et rédiger des cahiers des charges</p>\n<p><br>? Élaborer des spécifications fonctionnelles</p>\n<p><br>? Accompagner les tests et le développement des solutions</p>\n<p><br>? Former les utilisateurs et assurer leur support</p>\n<p><br>?? Paramétrer les solutions et animer des ateliers</p>\n<p><br>? Identifier dysfonctionnements et évolutions nécessaires</p>\n<p><br>? Effectuer une veille technologique dans le domaine de la santé<br>&nbsp;</p>\n','<p>Profil recherché :</p>\n<p><br>Connaissance du milieu hospitalier</p>\n<p><br>Diplôme en biologie ou paramédical, expérience en milieu clinique</p>\n<p><br>Excellentes qualités relationnelles et sens de l’écoute</p>\n<p><br>Rigueur, organisation et intérêt pour l’informatique</p>\n','<p>Si vous souhaitez améliorer le quotidien de milliers de patients et de professionnels de santé, n’hésitez pas à postuler !&nbsp;&nbsp;</p>\n',2162,'2024-11-05 10:22:19','2024-11-05 10:22:19'),(45,'2025-03-25','2025-03-25','publish','Consultant Technico-Fonctionnel ERP (GRH-PAIE)','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Consultant Technico-Fonctionnel ERP (GRH-PAIE)','<ul>\n<li>Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs ?</li>\n<li>Vous avez une expertise d’intégration des solutions<br>informatiques de gestion GRH/Paie. Idéalement, un dans un ERP avec une très bonne connaissance des métiers et<br>fonctions de la GRH/Paie. Rejoignez nos experts !</li>\n<li>Intégrer au sein de nos équipes projets, vous prendrez<br>en charge la gestion complète des projets d’implémentation de l’ERP GRH/Paie.</li>\n<li>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs.</li>\n</ul>\n','<ul>\n<li>Profil : -H/F&nbsp;</li>\n<li>Diplômé(e) d’un BAC+ 5 en informatique, avec connaissances métier GRH/PAIE.</li>\n<li>Expérience de 1 à 3 minimum ans dans l’intégration de solutions GRH/PAIE.</li>\n<li>Connaissances de l’ERP SAP est un plus.</li>\n</ul>\n','<p>/</p>\n',6585,'2025-03-25 17:15:24','2025-03-25 17:18:33'),(46,'2025-03-25',NULL,'publish','Consultant Technique ERP','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Consultant Technique ERP','<p>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoins nos experts !</p>\n<p>Intégré à nos équipes projets, vous participerez à la réalisation des projets d\'implémentation de l\'ERP.</p>\n<p>Vous prenez en charge le développement d\'applications connexes, des interfaces et de pultiples programmes spécifiques.</p>\n<p>Vous aurez également la responsabilité de développer les éditions et états de synthèse.</p>\n<p>Vous avez une première expériene dans le développement en dot net, java, web idéalement sous contraintes, notamment au sein d\'applications de gestion de type ERP ?</p>\n<p>Vous connaissez Crystal Reports BI et vous maîtrisez le langage de requête SQL ?</p>\n','<ul>\n<li>Diplômé(e) d\'un BAC+5 ou TS en informatique, option système d\'information, Software...</li>\n<li>Avec ou sans expérience dans le développement informatique (dot.net, java,web...)</li>\n<li>Connaissances du monde de l\'ERP et de l\'intégration de solutions de gestion d\'entreprises est un atout.</li>\n</ul>\n','<p>/</p>\n',6586,'2025-03-25 17:17:13','2025-03-25 17:17:13'),(47,'2025-03-25',NULL,'publish','Consultant Technico-fonctionnel ERP','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Consultant Technico-fonctionnel ERP','<ul>\n<li>Consultant Technico-fonctionnel ERPCM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos experts</li>\n<li>Le langage SQL n’a aucun secret pour vous ! Alors si l’immersion dans différents cœur métier vous passionne aussi bien que la compétence, rejoignez notre équipe technique qui vous attend de pied ferme.</li>\n<li>Intégré à nos équipes projets, vous participerez à la réalisation des projets d’implémentation de l’ERP.</li>\n<li>Vous avez ou non une expérience d’intégration des solutions informatiques de gestion d’entreprises. Idéalement, un ERP avec une bonne connaissance des métiers et fonctions de l’entreprises (comptabilité, achats, ventes, stocks, la paie, la gestion de projet et de production...)</li>\n</ul>\n','<ul>\n<li>Diplômé(e) d’un BAC+5 ou Technicien Supérieur en informatique, option système d’information, Software, décisionnel...</li>\n<li>Connaissance de l’environnement SAP et Crystal Report est un plus</li>\n</ul>\n','<p>/</p>\n',6588,'2025-03-25 17:21:21','2025-03-25 17:21:21'),(48,'2025-03-25',NULL,'publish','Community Management','2025-03-25','2025-12-31','Stage','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Community Management','<ul>\n<li>Tu es à l\'aise avec les réseaux sociaux et l\'animation de communauté ?</li>\n<li>Tu as une forte culture digitale et tu es au fait des dernières stratégies et tendances digitales, ce qui te permet d’être force de proposition et d’innover ?</li>\n</ul>\n','<p>Cher(e) futur(e) candidat(e), nous attendrons de toi :</p>\n<ul>\n<li>Dynamisme, pro-activité, et esprit d’initiative</li>\n<li>Organisation / Esprit d’équipe</li>\n<li>Élaborer et tenir à jour le planning social media;</li>\n<li>Animer et modérer notre communauté : répondre aux questions, aux commentaires, créer des stories pertinentes, des lives quand cela est opportun...</li>\n<li>Assurer une veille journalière : rebondir sur l’actualité des ESN et l’écosystème IT;</li>\n<li>Assurer une veille concurrentielle récurrente;</li>\n<li>Définir et mettre en œuvre une stratégie de marketing d\'influence;</li>\n<li>Créer des contenus originaux pour nos différentes plateformes et évènements (email, réseaux sociaux, newsletters, événements physiques...)</li>\n<li>Assurer le suivi et le reporting des performances;</li>\n</ul>\n<p></p>\n','<ul>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,53,140);font-size: medium;font-family: Poppins, sans-serif;\"><strong>Durée du stage :</strong> 06 mois</span></li>\n<li style=\"text-align:start;\"><span style=\"color: rgb(0,53,140);font-size: medium;font-family: Poppins, sans-serif;\"><strong>Lieu :</strong> Ben Aknoun - Alger</span></li>\n</ul>\n',6589,'2025-03-25 17:23:52','2025-03-25 17:23:52'),(49,'2025-03-25',NULL,'publish','Administrateur réseau & systèmes','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Administrateur réseau & systèmes','<ul>\n<li>Rattaché au responsable infrastructure, vous êtes en charge de l\'administration des système &amp; infrastructures des clients.</li>\n<li>Vous avez pour mission :</li>\n<li>Veiller au bon fonctionnement de l’infrastructure IT de l’entreprise (Installation, configuration).</li>\n<li>Assurer la mise à niveau et l’évolution de l’infrastructure IT en fonction des besoins de l’entreprise.</li>\n<li>Analyser les besoins du client<br>Assurer la disponibilité des services IT aux utilisateurs (Supervision, monitoring, dépannage…).</li>\n<li>Participation active dans des projets.<br>Administration des réseaux LAN, WAN, VPN de l’entreprise (Switching/Routing).</li>\n<li>Administration d’une plateforme virtuelle VMWARE, Hyper-V.</li>\n<li>Gestion d’un domaine Active Directory Microsoft Windows 2019.</li>\n<li>Gestion opérationnelle des sauvegardes de données via Veeam, NetBackup..<br>Gestion opérationnelle de la sécurité des SI (Firewalling SOPHOS, Fortinet…).</li>\n<li>Assurer un rôle de support et d’assistance technique auprès des équipes informatiques du client</li>\n<li>Veiller au respect des normes et des procédures de qualité et de sécurité<br>Accompagner les évolutions techniques.<br>Formaliser les process</li>\n</ul>\n','<ul>\n<li>De formation Bac+5, vous justifiez d’une expérience de 2 ans minimum dans un poste similaire Sérieux, autonome, impliqué.</li>\n<li>Vous disposez de bonnes capacités d’analyse et relationnelles pour le suivi client.</li>\n</ul>\n','<p>/</p>\n',6590,'2025-03-25 17:25:39','2025-03-25 17:25:39'),(50,'2025-03-25',NULL,'publish','Développeur Full Stack','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Développeur Full Stack','<p>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos experts !</p>\n<p>Missions du poste :</p>\n<ul>\n<li>Développement des applications web ou mobile pour nos besoins opérationnels.</li>\n<li>Participer à la mise en œuvre des outils développés auprès des utilisateurs finaux.</li>\n<li>Maintenir la disponibilité des outils existants et en assurer les évolutions.</li>\n</ul>\n','<ul>\n<li>Passionné par le développement et la conception, aisance relationnelle pour communiquer clairement par vos actions.</li>\n<li>Capacité à écrire du code propre et bien documenté.</li>\n<li>Conception d’interface utilisateur, sens du design.</li>\n<li>Maîtrise des technologies suivantes : HTML, CSS, PHP, JavaScript, React Native, GIT, SQL.</li>\n</ul>\n','<p>/</p>\n',6591,'2025-03-25 17:27:20','2025-03-25 17:27:20'),(51,'2025-03-25',NULL,'publish','Développeur Java','2025-03-25','2025-12-25','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Développeur Java','<p>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos experts !</p>\n<p><strong>Les missions sont les suivantes :</strong></p>\n<ul>\n<li>Concevoir, développer et maintenir des services métiers et des API REST</li>\n<li>Contribuer à toutes les phases du cycle de développement</li>\n<li>Produire un code propre, documenté et réutilisable</li>\n<li>Rédiger et maintenir les tests ainsi que la documentation technique</li>\n<li>Partager ton expérience et monter en compétences avec les autres membres de l’équipe</li>\n</ul>\n','<p><strong>Compétences techniques :</strong></p>\n<ul>\n<li>La connaissance de Framework Spring boot</li>\n<li>Vous avez une connaissance des architectures distribuées et des architectures orientées micro-services</li>\n<li>Vous avez une connaissance des méthodologies agiles (Kanban, Scrum)</li>\n<li>Vous avez des compétences éprouvées en ingénierie (code versioning, Peer review)</li>\n</ul>\n','<p>/</p>\n',6592,'2025-03-25 17:28:47','2025-03-25 17:28:47'),(52,'2025-03-25','2025-03-25','publish','Community Manager','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Community Manager','<p>CM Consulting, une entreprise technologique<br>leader en Algérie, recherche une personne dynamique et talentueuse pour<br>rejoindre notre équipe en tant que Responsable de communauté. Dans ce rôle,<br>vous serez responsable de la création et de la gestion d\'une communauté en<br>ligne solide pour notre marque, en favorisant l\'engagement et en promouvant des<br>interactions positives. En tant que Responsable de communauté, vous jouerez un<br>rôle essentiel dans l\'amélioration de notre présence en ligne et le<br>renforcement de nos relations avec les clients, les parties prenantes et les<br>influenceurs de l\'industrie.</p>\n<p><strong>Responsabilités :</strong></p>\n<ul>\n<li>Développer et mettre en œuvre une stratégie complète de gestion de communauté alignée sur la vision et les objectifs de la marque CM Consulting.</li>\n<li>Créer du contenu attractif, y compris<br>des publications sur les réseaux sociaux, des articles de blog, des newsletters<br>et d\'autres supports de communication pour attirer et fidéliser les membres de<br>la communauté.</li>\n<li>Surveiller et modérer les<br>plateformes en ligne, y compris les réseaux sociaux, les forums et les sites<br>web communautaires, afin de garantir un environnement positif et respectueux.</li>\n<li>Répondre aux demandes,<br>commentaires et rétroactions de la communauté de manière professionnelle et en<br>temps opportun, en adoptant une approche centrée sur le client.</li>\n<li>Établir et entretenir des<br>relations avec les membres de la communauté, les parties prenantes et les<br>influenceurs de l\'industrie pour favoriser l\'engagement et l\'adhésion.</li>\n<li>Collaborer avec des équipes<br>interfonctionnelles, notamment le marketing, le service client et le<br>développement de produits, pour recueillir des informations et intégrer les<br>retours de la communauté dans les stratégies commerciales.</li>\n<li>Organiser et gérer des événements<br>communautaires, en ligne et hors ligne, tels que des webinaires, des chats en<br>direct, des rencontres et des conférences, pour favoriser les échanges et le<br>partage de connaissances.</li>\n<li>Surveiller et analyser les<br>principales mesures de la communauté, et fournir régulièrement des rapports à<br>la direction, mettant en évidence les tendances, les opportunités et les défis.</li>\n<li>Rester à jour sur les tendances de<br>l\'industrie, les meilleures pratiques et les technologies émergentes en matière<br>de gestion de communauté, et formuler des recommandations pour l\'amélioration<br>continue.</li>\n</ul>\n','<ul>\n<li>Diplôme universitaire en communication, marketing, commerce ou dans un domaine connexe.</li>\n<li>Expérience avérée en gestion de communauté, en gestion des médias sociaux ou en marketing numérique.</li>\n<li>Solide compréhension de la dynamique des communautés en ligne, des plateformes de médias sociaux et des<br>systèmes de gestion de contenu.</li>\n<li>Excellentes compétences en communication écrite et verbale en français et en arabe, avec la capacité<br>d\'adapter les messages à différents publics.</li>\n<li>Compétences interpersonnelles exceptionnelles et capacité à établir des relations avec des parties prenantes<br>diverses.</li>\n<li>Esprit analytique avec la capacité d\'interpréter les données, de suivre les mesures et de fournir des informations<br>exploitables.</li>\n<li>Capacité à penser de manière créative et à résoudre des problèmes pour engager et fidéliser efficacement les<br>membres de la communauté.</li>\n<li>Maîtrise des outils et plateformes de gestion des médias sociaux.</li>\n<li>Passion pour la technologie et capacité à se tenir informé des dernières tendances de l\'industrie.</li>\n<li>Capacité à travailler de manière autonome, à gérer plusieurs tâches simultanément et à respecter les délais dans un environnement dynamique.</li>\n</ul>\n','<p>/</p>\n',6593,'2025-03-25 17:31:26','2025-03-25 17:33:02'),(53,'2025-03-25',NULL,'publish','DevOps','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','DevOps','<ul>\n<li>Consultant Technico-fonctionnel ERP</li>\n<li>CM Consulting, c’est avant tout un collectif d’experts en digitalisation, tous<br>unis par l’envie de dépasser leurs objectifs. Vous êtes avide de challenge et<br>vous aimez vous surpassez pour aller atteindre vos objectifs, rejoignez nos<br>experts !</li>\n<li>Le langage SQL n’a aucun secret pour vous ! Alors si l’immersion dans différents<br>cœur métier vous passionne aussi bien que la compétence, rejoignez notre équipe<br>technique qui vous attend de pied ferme.</li>\n<li>Intégré à nos équipes projets, vous participerez à la réalisation des projets d’implémentation de<br>l’ERP.</li>\n<li>Vous avez ou non une expérience d’intégration des solutions informatiques de gestion d’entreprises. Idéalement,<br>un ERP avec une bonne connaissance des métiers et fonctions de l’entreprises<br>(comptabilité, achats, ventes, stocks, la paie, la gestion de projet et de<br>production…)</li>\n</ul>\n','<ul>\n<li>H/F :</li>\n<li>Diplômé(e) d’un BAC+5 Polytechnique,<br>Recherche Opérationnelle…<br>Diplômé(e) d’un BAC+5 ou<br>Technicien Supérieur en informatique, option système d’information,<br>Software, décisionnel…<br>Connaissance de l’environnement<br>SAP et Crystal Report est un<br>plus<br>Votre capacité<br>rédactionnelle, votre esprit d’initiative, votre sens de l’organisation et<br>votre rigueur seront autant d’atouts pour réussir dans ce poste.</li>\n<li>Vous êtes également<br>doté de véritables capacités relationnelles et de travail en équipe et vous<br>êtes rompue à la culture de l’engagement. CM Consulting vous offre les<br>possibilités d’une carrière évolutive et d’une montée en compétence continue.</li>\n</ul>\n','<p>/</p>\n',6595,'2025-03-25 17:34:36','2025-03-25 17:34:36'),(54,'2025-03-25',NULL,'publish','Consultant SAP S/4HANA','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Consultant SAP S/4HANA','<ul>\n<li>Nous recherchons des consultants SAP S/4HANA (FI, CO, SD, MM, PP, QM, PM, PS, HCM, SCM) engagés et<br>enthousiastes pour enrichir notre équipe exceptionnelle.</li>\n<li>En tant que consultant SAP S/4HANA, vous serez au cœur de notre mission pour révolutionner les<br>processus métier de nos clients avec des solutions innovantes et sur mesure.</li>\n<li>Ce que vous allez faire :</li>\n<li>Innover au quotidien : Analysez les besoins uniques de nos clients et concevez des solutions SAP S/4HANA qui transforment leur manière de travailler. Chaque projet est une nouvelle opportunité pour créer de la valeur et faire la différence.</li>\n<li>Collaborer avec passion : Travaillez étroitement avec nos clients pour comprendre leurs défis et leurs objectifs. Votre expertise sera le catalyseur de leur succès et de leur croissance.</li>\n<li>Créer des solutions sur mesure : Contribuez à la conception, configuration et mise en œuvre de systèmes SAP S/4HANA parfaitement adaptés à chaque client.</li>\n<li>Former et inspirer : Accompagnez les utilisateurs finaux dans l’adoption de solutions innovantes et maximisez leur utilisation des fonctionnalités.<br>Évoluer ensemble : Offrez un soutien continu après l’implémentation et participez à l\'amélioration continue de nos solutions innovantes.</li>\n</ul>\n','<ul>\n<li>Une solide expérience dans la mise en œuvre de projets SAP S/4HANA, avec une passion pour l’excellence et l’innovation.</li>\n<li>Des compétences exceptionnelles en communication et en gestion de la relation client, avec une capacité à jongler entre plusieurs projets.</li>\n<li>Un diplôme en informatique, en génie des systèmes d\'information ou un domaine connexe, et une motivation sans faille pour développer vos compétences et rester à jour avec les dernières évolutions technologiques.</li>\n</ul>\n','<p>/</p>\n',6596,'2025-03-25 17:36:28','2025-03-25 17:36:28'),(55,'2025-03-25','2025-08-20','publish','Référent métier SI Santé','2025-03-25','2025-12-31','Emploi','Plein temps','Algérie','Alger','recrutement@cmconsulting-dz.com','Référent métier SI Santé','<p>Rejoignez CM Consulting et contribuez à l\'innovation dans le secteur de la santé !</p>\n<p>Nous recherchons un Référent métier SI Santé passionné pour rejoindre notre<br>équipe au cœur de la transformation digitale.&nbsp;</p>\n<p><strong>Votre mission :</strong></p>\n<ul>\n<li>Analyser les besoins utilisateurs</li>\n<li>Modéliser les processus et rédiger des cahiers des charges</li>\n<li>Élaborer des spécifications fonctionnelles</li>\n<li>Accompagner les tests et le développement des solutions</li>\n<li>Former les utilisateurs et assurer leur support</li>\n<li>Paramétrer les solutions et animer des ateliers</li>\n<li>Identifier dysfonctionnements et évolutions nécessaires</li>\n<li>Effectuer une veille technologique dans le domaine de la santé</li>\n</ul>\n','<ul>\n<li>Connaissance du milieu hospitalier</li>\n<li>Diplôme en biologie ou paramédical, expérience en milieu clinique</li>\n<li>Excellentes qualités relationnelles et sens de l’écoute</li>\n<li>Rigueur, organisation et intérêt pour l’informatique</li>\n</ul>\n','<p>/</p>\n',6597,'2025-03-25 17:38:20','2025-08-20 21:48:21'),(56,'2025-05-25',NULL,'publish','Test from cvtheque','2025-05-25','2025-05-31','Emploi','Plein temps','Algérie','Chlef','recrutement@cmconsulting-dz.com','Test from cvtheque','<p>test</p>\n','<p>test</p>\n','<p>test</p>\n',6734,'2025-05-25 15:54:26','2025-05-25 15:54:26');
